import React from 'react';
import API from '../Api';//Cambiar a constantes
import axios from 'axios';
import {DataTable,Column} from 'primereact/datatable';
import {Button} from 'primereact/button';


class BienesApi extends React.Component {
    
    constructor() {
        super();
        this.state = { fiduca: {data:[]} };
        
    }

    llamada() {
        return axios.get('http://127.0.0.1:7101/FiduciaWeb/getRef.do?json={"id":"funRegistroGarantias"}')
               .then(res => res);
    }

    componentDidMount() {
        
        this.llamada().then(data => {
            this.setState({fiduca: data});
        });
        
    }
    
    render() {
        var carCount = this.state.fiduca.data ? this.state.fiduca.data.length: 0;
        var header = <div className="p-clearfix" style={{'lineHeight':'1.87em'}}>Listado de bienes <Button icon="pi pi-refresh" style={{'float':'right'}}/></div>;
        var footer = "Existen " + carCount + ' Bienes';

        let cols = [
            {field: 'fgarIdFideicomiso', header: 'Fiso', sortable:true},
            {field: 'fgarCveGarantia2', header: 'Garantia'},
            {field: 'fgarImpGarantizadFormatted', header: 'Importe'},
            {field: 'fgarCveStatus', header: 'Status'}
        ];

        let dynamicColumns = cols.map((col,i) => {
            return <Column key={col.field} field={col.field} header={col.header} body={this.actionTemplate} style={{textAlign:'center', width: '6em'}}/>;
        });

        return (
            <div className="datatable-doc-demo">
                <DataTable value={this.state.fiduca.data}
                    header={header} 
                    footer={footer} 
                    paginator={true} 
                    rows={10} 
                    first={this.state.first} 
                    onPage={(e) => this.setState({first: e.first})}
                    selectionMode="single"
                    responsive={true}>
                    {dynamicColumns}
                </DataTable>
            </div>
        );
    }
}
export default BienesApi;
